var $bm_rt;
var nullLayerNames = [
        'Shape Layer 1: Path 1 [1.1.0]',
        'Shape Layer 1: Path 1 [1.1.1]',
        'Shape Layer 1: Path 1 [1.1.2]',
        'Shape Layer 1: Path 1 [1.1.3]',
        'Shape Layer 1: Path 1 [1.1.4]'
    ];
var nullLayerNamesIn = [
        'Shape Layer 1: Path 1 [1.1.0][In]',
        'Shape Layer 1: Path 1 [1.1.1][In]',
        'Shape Layer 1: Path 1 [1.1.2][In]',
        'Shape Layer 1: Path 1 [1.1.3][In]',
        'Shape Layer 1: Path 1 [1.1.4][In]'
    ];
var nullLayerNamesOut = [
        'Shape Layer 1: Path 1 [1.1.0][Out]',
        'Shape Layer 1: Path 1 [1.1.1][Out]',
        'Shape Layer 1: Path 1 [1.1.2][Out]',
        'Shape Layer 1: Path 1 [1.1.3][Out]',
        'Shape Layer 1: Path 1 [1.1.4][Out]'
    ];
var origPath = thisProperty;
var origPoints = origPath.points();
var origInTang = origPath.inTangents();
var origOutTang = origPath.outTangents();
var getNullLayers = [];
var getNullLayersIn = [];
var getNullLayersOut = [];
for (var i = 0; i < nullLayerNames.length; i++) {
    try {
        getNullLayers.push(effect(nullLayerNames[i])('ADBE Layer Control-0001'));
        getNullLayersIn.push(effect(nullLayerNamesIn[i])('ADBE Layer Control-0001'));
        getNullLayersOut.push(effect(nullLayerNamesOut[i])('ADBE Layer Control-0001'));
    } catch (err) {
        getNullLayers.push(null);
    }
}
for (var i = 0; i < getNullLayers.length; i++) {
    if (getNullLayers[i] != null && getNullLayers[i].index != thisLayer.index) {
        origPoints[i] = fromCompToSurface(getNullLayers[i].toComp(getNullLayers[i].anchorPoint));
        origInTang[i] = $bm_sub(fromCompToSurface(getNullLayersIn[i].toComp(getNullLayersIn[i].anchorPoint)), origPoints[i]);
        origOutTang[i] = $bm_sub(fromCompToSurface(getNullLayersOut[i].toComp(getNullLayersOut[i].anchorPoint)), origPoints[i]);
    }
}
$bm_rt = createPath(origPoints, origInTang, origOutTang, origPath.isClosed());
